# Dmitriyevka, Mrakovsky Selsoviet, Gafuriysky District, Republic of Bashkortostan

}}
Dmitriyevka () is a rural locality (a village) in Mrakovsky Selsoviet, Gafuriysky District, Bashkortostan, Russia. The population was 67 as of 2010.
Geography
It is located 31&nbsp;km from Krasnousolsky and 3&nbsp;km from Mrakovo.
